// src/App.js
import React from 'react';
import './App.css';
import ThreeScene from './Threescene';

function App() {
  return (
    <div className="App">
      <ThreeScene />
      <header className="App-header">
        <h1>3D Durga Saptasati</h1>
        <p>Rendering 3D models with Three.js in React</p>
      </header>
    </div>
  );
}

export default App;
